import React from "react";

const images = [
        '../src/assets/blue.png',
        '../src/assets/pink.jpg',
        '../src/assets/plain.png',
        '../src/assets/rasberry.png',
        '../src/assets/sugar.png'
        ];

function Card(props) {
    return images.map((item) => (
        <Card 
            key={item.i}
            // style={{background: item}}
        />
    ));
}

export default Card;
